import storage from "./storage"
import { getCategories } from "./categories"

const loadInitialData = () => {
    getCategories().then(data => {
        if(!data.length){
            storage.save({
                key: "categories",
                data: [
                    "Hombros",
                    "Triceps",
                    "Biceps",
                    "Pectoral",
                    "Espalda",
                    "Piernas",
                    "Abdominales"
                ]
            });
        }
    });
}

export default loadInitialData;
